//Http interceptor registered on tax-app
//Note: We can't inject authService directly into our interceptor, because it
//would create a circular dependency. Instead, we inject $injector
//service, and then use it to access the 'authService' service at call time.
commonServices.factory('httpInterceptor', ['$q', '$window', '$location', '$log', '$injector', '$rootScope', 'toaster', 'messageService', 'localStorageUtilityService', 'userService', 'resellerService', 'browserService', function ($q, $window, $location, $log, $injector, $rootScope, toaster, messageService, localStorageUtilityService, userService, resellerService, browserService) {
    var httpInterceptor = {};

    //Counter holding invalidCRF Attempt.
    var invalidCSRFAttempt = 0;

    /*var isModalOpen = false;*/
    //Holding url of api call which got invalid CSRF error
    var invalidCSRFErrorURL = '';

    //Avoid X-TaxYear list
    var avoidTaxYearHeaderList = [
        'https://media.',
        '/auth/',
    ];

    httpInterceptor.request = function (config) {
        //Append unique identifire to avoid caching.
        //All POST request, session and version from GET requests
        if (config.url != '' && (config.method == 'POST') || (config.url.indexOf('auth/session') > -1 || config.url.indexOf('app/version/get') > -1)) {
            config.url = config.url + '?TS=' + (new Date().getTime());
        }

        //Send XSRF Token
        if (localStorageUtilityService.checkLocalStorageKey('xsrfToken') == true) {
            config.headers['X-XSRF-TOKEN'] = localStorageUtilityService.getFromLocalStorage('xsrfToken');
        }

        //Send Location id if exist and selected taxyear (default if user has not changed)
        //Argument false means do not fallback from current location > Default > Master
        var locationId = userService.getLocationId(false);
        if (!_.isUndefined(locationId) && locationId != '') {
            config.headers['X-Location'] = locationId;
        }
        //set taxYear. If user is not logged in/ or there is no year set by user. Fallback to default one.
        //set appId. If there is no appId in reseller config do not send it.
        if (config.url.indexOf('https://media.') == -1) {
            var _appId = resellerService.getValue('appId');
            if (!_.isUndefined(_appId) && _appId != '') {
                config.headers['X-Appid'] = _appId;
            }
        }

        //X-Taxyear
        //Check if current url is in black list for tax year header. Do not pass X-Tax year for these urls(s)
        var _avoidTaxYear = false;
        for (var index in avoidTaxYearHeaderList) {
            if (config.url.indexOf(avoidTaxYearHeaderList[index]) >= 0) {
                _avoidTaxYear = true;
            }
        }
        if (_avoidTaxYear == false) {
            config.headers['X-Taxyear'] = userService.getTaxYear();
        }

        return config || $q.when(config);
    };

    httpInterceptor.requestError = function (rejection) {
        return $q.reject(rejection);
    };

    /* Set Authentication.isAuthenticated to true if 200 received */
    httpInterceptor.response = function (response) {
        if (response != null) {
            //Store XSRF-Token
            if (response.headers('XSRF-TOKEN') != null && (_.isUndefined(response.config.cached) || (!_.isUndefined(response.config.cached) && response.config.cached == false))) {
                localStorageUtilityService.addToLocalStorage('xsrfToken', response.headers('XSRF-TOKEN'));
            }
        }

        if (response.status == 200 && response.data.code != undefined && response.data.code != '') {
            //If invalidCSRFAttempt is not 0 (Means we have hold original request) and url of hold vs this is same then reset attempt 0
            if (invalidCSRFAttempt > 0 && invalidCSRFErrorURL != '' && response.config.url != undefined && response.config.url.indexOf('/auth/session') < 0 && invalidCSRFErrorURL == response.config.url) {
                invalidCSRFAttempt = 0;
            }

            //Success mesassage
            messageService.showMessage('', '', 'DAPI_' + response.data.code);
        }

        return response || $q.when(response);
    };

    /* Revoke client authentication if 401 is received */
    httpInterceptor.responseError = function (rejection) {
        if (rejection != null) {
            //Store XSRF-Token
            if (rejection.headers('XSRF-TOKEN') != null && (_.isUndefined(rejection.config) || _.isUndefined(rejection.config.cached) || (!_.isUndefined(rejection.config) && !_.isUndefined(rejection.config.cached) && rejection.config.cached == false))) {
                localStorageUtilityService.addToLocalStorage('xsrfToken', rejection.headers('XSRF-TOKEN'));
            }

            if (rejection.status == 500) {
                //This is required for training and news part only.
                if (rejection.config.url.indexOf('training') == -1 && rejection.config.url.indexOf('news') == -1 && rejection.config.url.indexOf('crm') == -1) {
                    messageService.showMessage('', '', 'DAPI_' + (rejection.data.code || rejection.status));
                }
            } else if (rejection.status == 503) {
                //message key need to be change as it will come from API it self
                messageService.showMessage('', '', 'DAPI_' + (rejection.data.code || rejection.status));
            } else if (rejection.status == 400) {
                //message key need to be change as it will come from API it self
                messageService.showMessage('', '', 'DAPI_' + (rejection.data.code || rejection.status));
            } else if (rejection.status == 401) {
                messageService.showMessage('', '', 'DAPI_' + (rejection.data.code || rejection.status));
            } else if (rejection.status == 403) {
                if (rejection.data.code == 4006) {
                    /*var authService = $injector.get('authService');
                    var $http = $injector.get('$http');
                    return authService.pushSessionQueue('NO-TOKEN',function(){return $http(rejection.config);});*/
                    //Retry - Code
                    //To Avoid circular dependecy
                    var authService = $injector.get('authService');
                    var $http = $injector.get('$http');

                    var defer = $q.defer();
                    var promiseAuthService = defer.promise;
                    authService.createSession().then(function (success) {
                        defer.resolve();
                    }, function (error) {
                        $log.error(error);
                        defer.reject();
                    });

                    var promiseUpdate = promiseAuthService.then(function () {
                        return $http(rejection.config);
                    });

                    return promiseUpdate;
                    // Code - retry End
                } else if (rejection.data.code == 4005) {//4005 = Invalid CSRF
                    //Check invalid CSRF attempt
                    if (invalidCSRFAttempt == 0) {
                        //If Attempt is 0. Make make session request and on success of that session call re call error api with new token
                        invalidCSRFAttempt = 1;
                        invalidCSRFErrorURL = rejection.config.url;

                        var authService = $injector.get('authService');
                        var $http = $injector.get('$http');

                        var defer = $q.defer();
                        var promiseAuthService = defer.promise;
                        authService.createSession().then(function (success) {
                            defer.resolve();
                        }, function (error) {
                            $log.error(error);
                            defer.reject();
                        });

                        var promiseUpdate = promiseAuthService.then(function () {
                            return $http(rejection.config);
                        });

                        return promiseUpdate;
                    } else {//This means we have tried this api one more time for invalid csrf token. So do not try more.
                        //To Avoid circular dependecy
                        var authService = $injector.get('authService');
                        /*var dialogService = $injector.get('dialogService');
                    var localeService = $injector.get('localeService');*/
                        //Delete Token
                        localStorageUtilityService.removeFromLocalStorage('xsrfToken');
                        authService.setIsAuthenticated(false);
                        $rootScope.$evalAsync(function () {
                            //refresh page and redirect to login page
                            $location.path('/login');
                            browserService.reloadApplication();
                        });
						/*if(!isModalOpen){
							isModalOpen = true;
							//service used to translate the message to be shown in dialog
							localeService.translate("There is an issue in connection with server. We request you to login again..",'INVALID_TOKEN_MESSAGE').then(function(translatedText){
								//dialog congiguration
								var dialogConfiguration = {'keyboard':false,'backdrop':false,'size':'md','windowClass': 'my-class'};
								var dialog = dialogService.openDialog("custom",dialogConfiguration,"taxAppJs/common/partials/serverErrorMessageDialog.html","serverErrorDialogController",{dialogMessage:translatedText});
								dialog.result.then(function(){
									//We have to wrap location change inside $evalAsync,so that the location changes properly and everything stays in sync
									$rootScope.$evalAsync(function () {
										$location.path('/login');
										//$window.location.reload(true);//refresh page and redirect to login page
									});
								});
							});
						}*/
                    }
                } else if (rejection.data.code == 4004) {// 4004 = Unauthorized request
                    //To Avoid circular dependecy
                    var authService = $injector.get('authService');
                    //Delete Token
                    localStorageUtilityService.removeFromLocalStorage('xsrfToken');
                    authService.setIsAuthenticated(false);
                    //We have to wrap location change inside $evalAsync,so that the location changes properly and everything stays in sync
                    $rootScope.$evalAsync(function () {
                        $location.path('/login');
                        browserService.reloadApplication();
                    });
                }
            }

        }
        return $q.reject(rejection);
    };

    return httpInterceptor;
}]);

