// llll
    commonServices.factory('localeService', ['$q', '$translate', 'utilityService', function ($q, $translate, utilityService) {
    var localeService = {};

    //Third argument is used  IF we want to translate with variable replacement.
    // Example :- translate("You have entered invalid {{type}}.",'QUICKRETURNSUMMARY_INVALID{{type}}_MESSAGE',{'type' : $scope.maskType}).then(function(response){});
    localeService.translate = function (defaultMessage, messageKey, variable) {
        var deferred = $q.defer();
        //if given key is find then success part is executed else its goes to error part
        $translate(messageKey).then(function (translatedValue) {
            if (!_.isUndefined(variable)) {
                translatedValue = replaceVariableWithValue(defaultMessage, variable);
            }
            deferred.resolve(translatedValue);
        }, function (error) {
            if (!_.isUndefined(variable)) {
                defaultMessage = replaceVariableWithValue(defaultMessage, variable);
            }
            deferred.resolve(defaultMessage);
        });

        return deferred.promise;
    };


    // USECASE : IF we want to translate with variable replacement.
    // HERE we pass variable as an object and loop through all keys of that object. Then we replace that key with value.
    var replaceVariableWithValue = function (message, variable) {
        _.forEach(variable, function (value, key) {
            //IF value is undefined then we replace it with blank value
            //THIS is done to avoid append 'undefined' word in message.
            //IF this condition will be removed then message can contain 'undefined' word.
            if (_.isUndefined(value)) {
                value = "";
            }
            message = utilityService.replaceString(message, "{{" + key + "}}", value);
        });

        return message;
    };


    return localeService;
}]);

