commonServices.service('pendingRequests', function () {
    var pending = [];
    this.get = function () {
        return pending;
    };
    this.add = function (request) {
        pending.push(request);
    };
    this.remove = function (request) {
        //pending = _.filter(pending, function (p) {
        //    return p.url !== request;
        //});

        for (var id = 0; id < pending.length; id++) {
            if (pending[id].url === request) {
                pending.splice(id, 1);
            }
        }
    };
    this.cancelAll = function () {
        angular.forEach(pending, function (p) {
            p.canceller.resolve();
        });

        pending.length = 0;
    };
});

