//subscription service
commonServices.service('subscriptionService', ['$window', '$injector', 'dataAPI', 'mediaService', 'userService', function ($window, $injector, dataAPI, mediaService, userService) {
    var subscriptionService = {};

    //goto subscription page
    subscriptionService.goToSubscription = function (customerNumber) {
        //Check whether user is demo user or not.
        // IF Demo user then prompt for register.
        //ELSE open subscription module.
        if (userService.getValue('isDemoUser') == true) {
            var salesDialogService = $injector.get('salesDialogService');
            salesDialogService.openSalesDialog("subscription");
        } else {
            //Get logged in user's details
            var userDetail = userService.getUserDetails();
            //Customer number if not passed
            if (customerNumber == undefined) {
                if (!_.isUndefined(userDetails.locations) && !_.isUndefined(userDetails.locations[userDetails.masterLocationId])) {
                    customerNumber = userDetails.locations[userDetails.masterLocationId].customerNumber;

                }
            }
            //
            var masterLocationId = userDetail.masterLocationId;
            //Call media Service. Pass true as it is for subscription call
            mediaService.identifyAndCallView('subscription');
            //Redirect to subscription app
            $window.open(dataAPI.subscription_url + '/#/store?id=' + customerNumber + '&mLocation=' + masterLocationId + '&redirectUrl=' + $window.location.href.replace('#', '%23'), "_self");
        }
    };

    return subscriptionService;
}]);

