commonServices.service('softwareReleaseService', ['$http', '$log', '$interval', '$timeout', 'dataAPI', 'dialogService', function ($http, $log, $interval, $timeout, dataAPI, dialogService) {
    var softwareReleaseService = {};

    // Holding Released version
    var releasedVersion = "";

    var pullForRelease = undefined;

    //Manual (Startup) call for released version
    softwareReleaseService.manualVersionUpdate = function () {
        //Call to api for getting released version
        $http({
            method: 'GET',
            url: dataAPI.base_url + '/app/version/get'
        }).then(function (response) {
            releasedVersion = response.data.data;
            //Invoke auto check for release version
            invokePullForRelease();
        }, function (error) {
            $log.error(error);
            ////Invoke auto check for release version
            invokePullForRelease();
        });
    };

    //This function will start interval operation
    var invokePullForRelease = function () {
        //As we are not providing option to cancel in dialog we have used $timeout instead of $interval
        var pullForRelease = $interval(function () {
            //cancel pull first
            cancelPullForRelease();
            //call api
            $http({
                method: 'GET',
                url: dataAPI.base_url + '/app/version/get'
            }).then(function (response) {
                if (releasedVersion != '' && response.data.data != releasedVersion) {
                    var dialog = dialogService.openDialog("custom", { 'keyboard': false, 'backdrop': false, 'size': 'md' }, "taxAppJs/common/partials/newVersionReleasedDialog.html", "newVersionReleasedDialogController");
                    dialog.result.then(function (success) {
                        //Nothing to do
                    }, function (cancel) {
                        //restart interval
                        reInvokePullForRelease();
                    });
                } else {
                    //restart interval
                    reInvokePullForRelease();
                }
            }, function (error) {
                $log.error(error);
                //restart interval
                reInvokePullForRelease();
            });
        }, 900000);


        //This function is used to cancel interval for pulling release
        var cancelPullForRelease = function () {
            $interval.cancel(pullForRelease);
        };

        //This function will re invoke canceled interval for pulling release version
        var reInvokePullForRelease = function () {
            $timeout(function () {
                invokePullForRelease();
            }, 10000);
        };
    };

    return softwareReleaseService;
}]);

