/**
 * This service will manage system level loadingBar start/stop
 */
commonServices.factory('loadingBarService', ['$rootScope', '$timeout', function ($rootScope, $timeout) {
    var loadingBarService = {};

    //this will hold all requests raised for enabling loading bar
    var appLoadingBarRequestList = [];

    /**
 * Method that needs to be called when we require progress bar
 * @param featureName = name of feature that requested loading bar. For example, 'autoLogin'
 */
    loadingBarService.enableAppLoadingBar = function (featureName) {
        //Make it true if it is not already
        if ($rootScope.appLoadingBar != true) {
            $rootScope.appLoadingBar = true;
        }

        //push request to list
        appLoadingBarRequestList.push(featureName);
    };

    /**
 * This method needs to be called when we want to tunr off progress bar.
 * @param featureName = name of feature that requested loading bar. For example, 'autoLogin'
 */
    loadingBarService.disableAppLoadingBar = function (featureName) {
        //If this request is available in list (list of features requested loading bar) then remove it from there as it has completed its work
        if (appLoadingBarRequestList.indexOf(featureName) > -1) {
            appLoadingBarRequestList.splice(appLoadingBarRequestList.indexOf(featureName), 1);
        }

        //Note: we have used 500ms timeout because, most of time loading bar stopped instantly but application take few miliseconds to switch to next page.
        //For example in auto login, when we turn off loading bar after API call without timeout it will flash login page.
        $timeout(function () {
            //If there is no request in list and loading bar is not false, make it false.
            if ($rootScope.appLoadingBar != false && appLoadingBarRequestList.length == 0) {
                $rootScope.appLoadingBar = false;
            }
        }, 500);
    };

    return loadingBarService;
}]);


/**
 * This service will do inter process comunication with serviceworker
 */
commonServices.factory('serviceWorkerIPC', ['$q', '$timeout', '$injector', 'localStorageUtilityService', function ($q, $timeout, $injector, localStorageUtilityService) {
    var serviceWorkerIPC = {};

    //If service worker feature is available and registered
    if (('serviceWorker' in navigator) && navigator.serviceWorker.controller != null) {
        // Set up a listener for messages posted from the service worker.
        // The service worker is set to post a message to all its clients once it's run its activation
        navigator.serviceWorker.onmessage = function (event) {
            //
            switch (event.data.command) {
                case 'setXSRFToken':
                    localStorageUtilityService.addToLocalStorage('xsrfToken', event.data.data.xsrfToken);
                    break;
                case 'appVersionUpdated':
                    var _dialogservice = $injector.get('dialogService');
                    var dialog = _dialogservice.openDialog("custom", { 'keyboard': false, 'backdrop': false, 'size': 'md' }, "taxAppJs/common/partials/newVersionReleasedDialog.html", "newVersionReleasedDialogController", { "sourceOfAction": "offline" });
                    dialog.result.then(function (success) {
                        //Nothing to do
                    }, function (cancel) {
                        //User has cancelled
                    });
                    break;
                case 'staticVersionUpdatingStart':
                    var _cachingService = $injector.get('cachingService');
                    _cachingService.publishPreCacheStatus("RUNNING");
                    break;
                case 'staticVersionUpdatingFinish':
                    var _cachingService = $injector.get('cachingService');
                    _cachingService.evaluatePreCacheStatus();
                    break;
                case 'precacheMissingStates':
                    var _cachingService = $injector.get('cachingService');
                    _cachingService.startPreCache();
                    break;
                case 'getCacheListAndUpdateStatus':
                    postal.publish({
                        channel: 'MTPO-UI',
                        topic: 'getCacheListAndUpdateStatus',
                        data: {}
                    });
                    break;
            }
        };
    }

    // This wraps the message posting/response in a promise, which will resolve if the response doesn't
    // contain an error, and reject with the error if it does. If you'd prefer, it's possible to call
    // controller.postMessage() and set up the onmessage handler independently of a promise, but this is
    // a convenient wrapper.
    var _sendMessage = function (message) {
        var deferred = $q.defer();
        var messageChannel = new MessageChannel();
        messageChannel.port1.onmessage = function (event) {
            if (event.data.error) {
                deferred.reject(event.data.error);

            } else {
                deferred.resolve(event.data);
            }
        };
        // This sends the message data as well as transferring messageChannel.port2 to the service worker.
        // The service worker can then use the transferred port to reply via postMessage(), which
        // will in turn trigger the onmessage handler on messageChannel.port1.
        // See https://html.spec.whatwg.org/multipage/workers.html#dom-worker-postmessage
        navigator.serviceWorker.controller.postMessage(message, [messageChannel.port2]);
        return deferred.promise;
    };

    //Exposed method that used to send message to ServiceWorker
    serviceWorkerIPC.sendMessage = function (command, data) {
        //Promise
        var deferred = $q.defer();

        //If service worker feature is available and registered
        if (('serviceWorker' in navigator) && navigator.serviceWorker.controller != null) {
            //Prepare message
            var message = { "command": command, "data": data };
            //sned message
            _sendMessage(message).then(function (response) {
                //response
                deferred.resolve(response);
            }, function (error) {
                //error
                deferred.reject(error);
            });
        } else {
            //return 'isSericeWorkerAvailable' as false as service worker is not available
            deferred.resolve({ isSericeWorkerAvailable: false });
        }

        return deferred.promise;
    };

    //
    serviceWorkerIPC.preCache = function (data) {
        return serviceWorkerIPC.sendMessage('precache', data);
    };

    //
    serviceWorkerIPC.getCacheList = function () {
        return serviceWorkerIPC.sendMessage('cacheList');
    };

    //to get precache status of state
    serviceWorkerIPC.checkStatePrecacheStatus = function (data) {
        return serviceWorkerIPC.sendMessage('checkStatePrecacheStatus', data);
    };

    //To check cahce updates and download it if required
    serviceWorkerIPC.checkForCacheUpdate = function () {
        return serviceWorkerIPC.sendMessage('checkForCacheUpdate');
    };

    return serviceWorkerIPC;
}]);

/**
 * This service will be used to check health of network.
 * It will notify to respective code if user switch from online to offline or vice-versa
 */
commonServices.factory('networkHealthService', ['$http', '$q', '$interval', '$injector', '$rootScope', 'dataAPI', function ($http, $q, $interval, $injector, $rootScope, dataAPI) {
    var networkHealthService = {};

    var _networkCheckTimer = undefined;
    var _isOnline = true;

    /**
 * This method will check network avaibility and then register interval to check it every specific time
 */
    networkHealthService.startNetworkCheck = function () {
        //If service worker feature is available and registered
        if (('serviceWorker' in navigator) && navigator.serviceWorker.controller != null) {
            return _checkNetwork();
        } else {
            return false;
        }
    };

    //Call this functiion as result of network change
    var _analyzeNetworkCheckResponse = function (isOnline) {
        //If current result is different then previous one
        if (isOnline != _isOnline) {
            //If current result is online (offline -> online)
            if (isOnline == true) {
                //switched from offline to online
                _isOnline = isOnline;
                //Inform service worker
                var _serviceWorkerIPC = $injector.get('serviceWorkerIPC');
                _serviceWorkerIPC.sendMessage('switchToOnline', {});
            } else {
                //switched from online to offline
                _isOnline = isOnline;
            }

            //publish message (pub)
            postal.publish({
                channel: 'MTPO-UI',
                topic: 'networkStatus',
                data: {
                    isOnline: _isOnline
                }
            });
        }
    }

    //Real function that will call api to check if it is available
    var _checkNetwork = function () {
        var deferred = $q.defer();
        //http request
        $http({
            method: 'GET',
            url: dataAPI.base_url + '/auth/keepAlive',
        }).then(function (response) {
            //Analyze response
            _analyzeNetworkCheckResponse(true);
            //register interval
            _registerNetworkCheckInterval();
        }, function (error) {
            ////Analyze response
            _analyzeNetworkCheckResponse(false);
            //register interval
            _registerNetworkCheckInterval();
        });
        return deferred.promise;
    }

    //function which will register interval
    var _registerNetworkCheckInterval = function () {
        //If it is not already registered
        if (angular.isUndefined(_networkCheckTimer)) {
            _networkCheckTimer = $interval(function () {
                _checkNetwork();
            }, 5000);
        }
    };

    /**
     * This will return current network status.
     * Used to initialize local variable in other controller/service then after status change will be notified through Message Bus
     */
    networkHealthService.getNetworkStatus = function () {
        return _isOnline;
    };

    return networkHealthService;
}]);

/**
 * this service used for handle static offline
 */
commonServices.factory('cachingService', ['$rootScope', '$log', '$injector', '$q', 'dialogService', 'serviceWorkerIPC', function ($rootScope, $log, $injector, $q, dialogService, serviceWorkerIPC) {
    var cachingService = {};

    //time delay for background precache
    var _timeDelayForBackgroundPrecache = 10000;

    //hold current precache status
    var _currentPrecacheStatus;

    //this method will check service worker is supported and active then call  SW to precache stateList
    var _preCache = function (stateList, isBackGroundRunning) {
        var deferred = $q.defer();
        if (('serviceWorker' in navigator) && navigator.serviceWorker.controller != null) {
            //make back ground runnnig as false if is undefined
            isBackGroundRunning = isBackGroundRunning === undefined ? false : isBackGroundRunning;

            //hold statelist for precache
            var objStateList;
            if (stateList != undefined) {
                objStateList = stateList;
            }
            else {
                //inject user service runtime
                var _userService = $injector.get('userService');
                //get user details
                var _userDetail = _userService.getUserDetails();
                //get tax year
                var _currentYear = _userService.getTaxYear();
                if (_userDetail.settings != undefined && _userDetail.settings.preferences != undefined && _userDetail.settings.preferences.offline != undefined && _userDetail.settings.preferences.offline.offlinePreferences != undefined) {
                    if (_userDetail.settings.preferences.offline.offlinePreferences[_currentYear] != undefined && _userDetail.settings.preferences.offline.offlinePreferences[_currentYear].length > 0) {
                        objStateList = { "process": _userDetail.settings.preferences.offline.offlinePreferences[_currentYear] };
                    }
                }
            }

            if (objStateList != undefined) {
                setTimeout(function () {
                    //if (objStateList.process != undefined && objStateList.process.length > 0) //make precache running true online when user passed data length
                    //cachingService.publishPreCacheStatus("RUNNING");
                    //set isbackGround running  so in service worker we can handle different time delay
                    objStateList.isBackGroundRunning = isBackGroundRunning;
                    serviceWorkerIPC.preCache(objStateList).then(function (stateList) {
                        // on response just call precache status
                        //cachingService.evaluatePreCacheStatus();
                        deferred.resolve(stateList);
                    }, function (error) {
                        $log.error(error);
                        // on error just call precache status
                        //cachingService.evaluatePreCacheStatus();
                        deferred.reject();
                    });
                }, (isBackGroundRunning == true ? _timeDelayForBackgroundPrecache : 0));  //if function is called as background running call function after specific time delay
            } else { deferred.reject(); }
        }
        return deferred.promise;
    };
    // listen network status (sub)
    postal.subscribe({
        channel: 'MTPO-UI',
        topic: 'networkStatus',
        callback: function (data, envelope) {
            // whenever user is online just call precache
            if (data.isOnline == true) {
                _preCache();
                cachingService.preCacheAppFiles();
            }
            else {
                cachingService.evaluatePreCacheStatus(); // if user is go offline just call set precahe status
            }
        }
    });

    // method to handle for precache from user setting
    cachingService.startPreCache = function (stateList, isBackGroundRunning) {
        return _preCache(stateList, isBackGroundRunning);
    };

    //publish precache status
    cachingService.publishPreCacheStatus = function (_precacheStatus) {
        _currentPrecacheStatus = _precacheStatus;
        //publish message (pub)
        postal.publish({
            channel: 'MTPO-UI',
            topic: 'precacheStatus',
            data: {
                precacheStatus: _precacheStatus
            }
        });
    };

    cachingService.evaluatePreCacheStatus = function () {
        var deferred = $q.defer();
        var _objStateList = [];
        //inject user service runtime
        var _userService = $injector.get('userService');
        //get user details
        var _userDetail = _userService.getUserDetails();
        //get tax year
        var _currentYear = _userService.getTaxYear();

        if (_userDetail.settings != undefined && _userDetail.settings.preferences != undefined && _userDetail.settings.preferences.offline != undefined && _userDetail.settings.preferences.offline.offlinePreferences != undefined) {
            if (_userDetail.settings.preferences.offline.offlinePreferences[_currentYear] != undefined && _userDetail.settings.preferences.offline.offlinePreferences[_currentYear].length > 0) {
                _objStateList = angular.copy(_userDetail.settings.preferences.offline.offlinePreferences[_currentYear]);
            }
        }

        var _federalObject = { "state": "Federal", "year": _currentYear };
        // check for is federal already exist or not
        var isFederalExist = _.findIndex(_objStateList, function (objState) {
            return (objState.state == _federalObject.state && objState.year == _federalObject.year)
        });
        // if federal not exist then push in state list array
        if (isFederalExist == -1) {
            _objStateList.push(_federalObject);
        }
        // call SW to check state are cached or not
        serviceWorkerIPC.checkStatePrecacheStatus(_objStateList).then(function (response) {
            //after getting result filter on state which are not cached
            var nonCachedState = _.where(response.data, { 'preCache': false });
            //if and state that are not cached
            if (nonCachedState != undefined && nonCachedState.length > 0) {
                //check federal is cached or not
                var currentIndex = _.findIndex(nonCachedState, function (nonCachedStateObj) {
                    return (nonCachedStateObj.state == "Federal" && nonCachedStateObj.year == _currentYear)
                });
                //if federal is cached
                if (currentIndex == -1) {
                    cachingService.publishPreCacheStatus("YELLOW");
                } else {
                    cachingService.publishPreCacheStatus("RED");//federal is not cached
                }

            } else {
                cachingService.publishPreCacheStatus("GREEN");//return green if all state are successfully cached
            }
            deferred.resolve();
        });
        return deferred.promise;
    };

    /**
     * this method will return current precache status
      * */
    cachingService.getCurrentPreCacheStatus = function () {
        return _currentPrecacheStatus;
    };

    cachingService.preCacheAppFiles = function () {
        serviceWorkerIPC.sendMessage('preCacheAppFiles', {});
    };
    return cachingService;
}]);

